css:
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 1rem;
  font-weight: 600;
  border-top: 1px solid #2e303c;
  border-bottom: 1px solid #2e303c;
}
.github-UnstagedChanges > .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: #acafbe;
  margin-right: 0.83333333rem;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 1rem;
  font-weight: normal;
  border-left: 1px solid #2e303c;
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: #acafbe;
}
.github-StagingView-headerButton:active {
  background-color: #3b3e4d;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid #2e303c;
}
.github-StagingView-headerButton--iconOnly:before {
  width: auto;
}
.github-StagingView-title {
  flex: 1;
  margin-right: 1rem;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 0.5rem 1rem;
}
.github-StagingView-group.is-focused .is-selected {
  color: #f9f9fb;
  background: #3b3e4d;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: #484c5f;
}
